import React from 'react';
import img_cover from "../images/cover.png";
import '../style.css';
function Home() {
    return (
        <div className='container'>
            <div>

            <img src={img_cover} alt='img' className='img_cover' />
            </div>
        </div>
    )
}
export default Home;
